B.Uq=new A.bG("1) C\u2019est un aveugle qui rentre dans un bar, puis dans une table, puis dans une chaise, puis dans un mur\u2026\n\n2) Comment s'appelle une souris qui ne mange pas, ne boit pas et ne marche pas ? \n R\xe9ponse : Une souris d'ordinateur. \n\n3) Un geek ne s'ennuie pas, il se fichier. \n\n4) C'est un mec qui entre dans un bar et qui dit : \xab Salut c'est moi ! \xbb Mais en fait, c\u2019\xe9tait pas lui. \n\n5) Pourquoi l'\xe9l\xe9phant ne joue-t-il pas sur l'ordinateur ? \n R\xe9ponse : Parce qu'il a peur de la souris. \n\n6) Comment appelle-t-on une manifestation d\u2019aveugles ? \n R\xe9ponse : Un festival de Cannes. \n\n7) Que dit une m\xe8re \xe0 son fils geek pour qu'il vienne manger ? \n R\xe9ponse : Alt Tab ! \n\n8) Quel est l\u2019arbre pr\xe9f\xe9r\xe9 des ch\xf4meurs ? \n R\xe9ponse : Le bouleau. \n\n9) Pourquoi les livres ont-ils toujours chaud ? \n R\xe9ponse : Parce qu\u2019ils ont une couverture. \n\n10) Pourquoi les Geek sont-ils fiers ? \n R\xe9ponse : Parce qu'ils ont une Gygabyte.",null,B.bl,null,null,null,null,null,null)
B.UQ=new A.bG("\n\n10 histoires dr\xf4les de tonton",null,B.bU,null,null,null,null,null,null)
B.UI=new A.bG("1) Un homme demande \xe0 une femme dans la rue :\n\xab Avez-vous vu un policier ?\n - Non.\n - Alors donnez-moi votre sac \xe0 main. \xbb \n\n2) Une enfant prend l'avion avec sa m\xe8re pour la premi\xe8re fois.Enthousiasm\xe9e par ce voyage in\xe9dit, elle devient vite intenable. Sa m\xe8re,exc\xe9d\xe9e, la met en garde : \xab Je te pr\xe9viens, si tu n'es pas sage, on descend tout de suite ! \xbb \n\n3) Un homme entre dans un bar : \xab Bonjour, est-ce que vous servez desnouilles ? \xbb \xab Bien s\xfbr, ici on sert tout le monde monsieur. \xbb \n\n4) C\u2019est l\u2019histoire d\u2019un poil. Avant il \xe9tait bien, maintenant il est pubien. \n\n5) Deux mamans discutent :\n \xab J\u2019ai perdu mon chien\u2026\n - Fa\xeetes passer une annonce !\n - Cela ne sert \xe0 rien, il ne sait pas lire\u2026 \xbb \n\n6) C\u2019est deux fous qui marchent dans la rue. Le premier demande au second :\xab Je peux me mettre au milieu ? \xbb \n\n7) Dans un bar, deux hommes demandent au barman :\n \xab \xc0 votre avis lequel est le plus m\xe9chant, le lion ou le crocodile ?\n - Le crocolion ! C'est un animal avec une t\xeate de lion \xe0 un bout, et une t\xeatede crocodile \xe0 l'autre bout.\n - Ah ouais ? Et comment il fait pour faire caca ?\n - Il ne peut pas, c'est pour cela qu'il est m\xe9chant ! \xbb \n\n8) C'est l'histoire de deux mouches sur un caca de chien.\n \xab J'ai une de ces envies de p\xe9ter moi\u2026 \n - Gros d\xe9gueulasse, on est \xe0 table ! \xbb \n\n9) C'est l'histoire d'un mec qui rentre dans un bar : \n \xab Je voudrais deux bi\xe8res s\u2019il vous pla\xeet.\n \u2013 Des pressions ?\n \u2013 Non, alcoolisme. \xbb \n\n10) Une enfant de 10 ans demande \xe0 sa m\xe8re :\n \xab Maman, quand est-ce que j\u2019aurai des seins comme toi ?\n - Il te faudra un peu de patience, ma ch\xe9rie. Si tu tiens de moi, tu auras des seins comme les miens quand tu auras 5 000 euros ! \xbb",null,B.bl,null,null,null,null,null,null)
B.UE=new A.bG("\n\n10 meilleures blagues sur les pays \xe9trangers",null,B.bU,null,null,null,null,null,null)
B.Ut=new A.bG("1) Quel est le pays le plus cool au monde ?\n R\xe9ponse : Le Y\xe9\xe9\xe9men. \n\n2) Dans quel pays ne bronze-t-on pas du nez ?\n  R\xe9ponse : Au N\xe9pal. \n\n3) Pourquoi les Fran\xe7ais marchent sur les tuyaux d'arrosage ?\n R\xe9ponse : Pour avoir de l'eau plate !\n\n4) Quel est le pays qui est jamais d'accord pour rien ?\n R\xe9ponse : Le Pakistan. \n\n5) Quel pays demande qu\u2019on l'aide \xe0 apaiser les d\xe9mangeaisons \xe0 un endroit pr\xe9cis ? \n R\xe9ponse : Le Guatemala. \n\n6) Quel pays se sent quand m\xeame mis \xe0 l'\xe9cart du groupe injustement, tout \xe7a parce qu'il a plus d'argent ? \n R\xe9ponse : L\u2019Autriche. \n\n7) Quel pays s'assure \xe0 la fin des conf\xe9rences qu'il donne que le public a bien tout compris ? \n R\xe9ponse : Le Tadjikistan. \n\n8) Quel pays a \xe9t\xe9 touch\xe9 par une pauvret\xe9 aussi immense que soudaine et inattendue, le laissant sans voix ? \n R\xe9ponse : Le Bangladesh. \n\n9) Quel pays propose \xe0 ses amis de le rejoindre l\xe0 o\xf9 il se trouve ? \n R\xe9ponse : Le Venezuela. \n\n10) Quel pays est tr\xe8s bon pour juger ce qui est l\xe9gal et ce qui ne l'est pas ? \nR\xe9ponse : Le S\xe9n\xe9gal.",null,B.bl,null,null,null,null,null,null)
B.UN=new A.bG("\n\n10 jeux de mots dr\xf4les de tonton",null,B.bU,null,null,null,null,null,null)
B.UK=new A.bG("1) Quelle mamie fait peur aux voleurs ? \n R\xe9ponse : Mamie Traillette. \n\n2) J\u2019avais une blague sur les magasins, mais elle n\u2019a pas supermarch\xe9. \n\n3) Quel est le comble pour une voyante ? \n R\xe9ponse : De perdre la boule. \n\n4) Tu connais la blague de la chaise ? \nR\xe9ponse : Elle est pliante. \n\n5) Pourquoi les arbres puent ? \nR\xe9ponse : Parce que les troncs p\xe8tent. \n\n 6) C\u2019est l\u2019histoire d\u2019un chien et d\u2019un homme qui sont sur un bateau. Le chien p\xe8te et l\u2019homme se noie. Pourquoi ? \n R\xe9ponse : Parce que c\u2019est un P\xe9kinois ! \n\n7) Que fait un employ\xe9 de chez S\xe9phora \xe0 sa pause clope ? \n R\xe9ponse : Il parfumer (il part fumer) \n8) Pourquoi les chercheurs ont-ils des trous de m\xe9moire ? \n R\xe9ponse : Parce qu\u2019ils se creusent la t\xeate. \n\n9) Vous connaissez l'histoire de l'armoire ? \nR\xe9ponse : Elle n'est pas commode\u2026\n\n10) Un jour Dieu a dit \xe0 Casto de ramer. Et depuis, Castorama.",null,B.bl,null,null,null,null,null,null)
B.Ux=new A.bG("\n\n10 blagues pour les enfants",null,B.bU,null,null,null,null,null,null)
B.UD=new A.bG("1) Dans le bus, Toto est assis \xe0 cot\xe9 d'une vieille femme. Enrhum\xe9, l'enfant\nn'arr\xeate pas de renifler. Agac\xe9e, la vieille femme finit par lui dire :\n \xab Dis-moi, tu n'as pas de mouchoir ?\n - Si, mais je ne le pr\xeate pas ! \xbb \n\n2) Toto rentre de l'\xe9cole. En arrivant dans la cuisine, il sort de sa poche un \xe9norme caca de chien, la pose sur la table devant sa maman et lui dit : \xab Tu as vu, maman, dans quoi j'ai failli marcher ?! \xbb \n\n3) Le papa de Toto : \n\xab Toto, tu sais, on va avoir un b\xe9b\xe9 ! \n- C'est vrai ? Il faut pr\xe9venir maman ! \xbb \n\n4) Toto raconte \xe0 un autre enfant : \n\xab Mon prof est bizarre. L'autre jour, alors que je bavardais avec ma voisine, il adit : \"S\xe9parez-vous ou je vous colle\" ! \xbb \n\n5) Quel est l'animal qui a le plus de dents ? La petite souris. \n\n6) Toto demande \xe0 sa mamie : \n\xab Mamie, as-tu de bonnes dents ? \n- Malheureusement non, mon petit\u2026\n- Tr\xe8s bien ! Tu peux surveiller mes caramels ? \xbb \n\n7) Un enfant raconte : \n\xab Une fois, je me suis cass\xe9 le bras et je n'ai rien senti ! \n- C'est m\xeame pas vrai, r\xe9plique un autre enfant. \n- Si, j'avais le nez bouch\xe9 ! \xbb \n\n8) Deux mille pattes sont tomb\xe9s amoureux et ils se prom\xe8nent bras dessus, bras dessous, bras dessus, bras dessous, bras dessus, bras dessous\u2026\n\n9) Qu'est-ce qui a deux bosses et qui vit au P\xf4le Nord ? \n R\xe9ponse :Un chameau qui s'est perdu. \n\n10) Comment appelle-t-on une vieille barbe \xe0 papa ? \nR\xe9ponse : Une barbe \xe0 papi. \n\n",null,B.bl,null,null,null,null,null,null)
B.UH=new A.bG("\n\n10 blagues sur des c\xe9l\xe9brit\xe9s",null,B.bU,null,null,null,null,null,null)
B.UL=new A.bG("1) J\u2019ai essay\xe9 la veste de Gad et elle m\u2019allait.\n\n2) Un jour, Dieu demanda \xe0 David de guetter, et David Guetta. \n\n3) Soup\xe7onn\xe9 de vol dans une boulangerie, Florent Pagny nie. \n\n4) Pourquoi Napol\xe9on n\u2019a-t-il pas voulu acheter de maison ? \n R\xe9ponse : Parce qu\u2019il avait d\xe9j\xe0 un Bonaparte. \n\n5) Pourquoi est-ce que Winnie l\u2019Ourson veut absolument se marier ? \n R\xe9ponse : Pour partir en lune de miel. \n\n6) De quelle couleur est la voiture de John Travolta ? \n R\xe9ponse : Elle est grease. \n\n7) Quel est le fromage pr\xe9f\xe9r\xe9 de Brigitte Macron ? \n R\xe9ponse : Le Pr\xe9sident. \n\n8) O\xf9 irait Voldemort s\u2019il d\xe9cidait de jouer de la trompette ? \n R\xe9ponse : \xc0 Jazzkaban. \n\n9) Pourquoi Hulk a-t-il un beau jardin ? \n R\xe9ponse : Parce qu\u2019il a la main verte. \n10) Pourquoi Mickael ouvre sa porte ? \n R\xe9ponse : Parce que Jack sonne.",null,B.bl,null,null,null,null,null,null)
B.UO=new A.bG("\n\n10 devinettes dr\xf4les de tonton",null,B.bU,null,null,null,null,null,null)
B.Ur=new A.bG("1) Qu\u2019est-ce qui est bleu, blanc et rouge ?\n R\xe9ponse : Un Schtroumpf qui saigne du nez. \n\n2) Quel est le point commun entre un p\xeacheur et un mannequin ? \n R\xe9ponse : Ils surveillent leur ligne. \n\n3) Que fait un jardinier quand il ment ? \n R\xe9ponse : Il raconte des salades. \n\n4) Quelle est la lettre la plus tranchante ? \n R\xe9ponse : Le H. \n\n5) Quel est le fruit pr\xe9f\xe9r\xe9 des profs d\u2019histoire ? \nR\xe9ponse : Les dates. \n\n6) Qu\u2019est-ce qui est vert et qui se d\xe9place sous l\u2019eau ? \n R\xe9ponse : Un chou marin. \n\n7) De quelle couleur est le virus de la grippe ? \nR\xe9ponse : Gris p\xe2le. \n\n8) Qu'est-ce qui est vert et qui pousse dans le jardin ? \n R\xe9ponse : Un extraterrestre qui fait caca. \n\n9) Quel est le m\xe9decin qui nous fait tous craquer ? \n R\xe9ponse : L\u2019ost\xe9o. \n\n10) Quelle est la femme la plus intelligente entre la blonde, la brune et la rousse ? \n R\xe9ponse : C\u2019est Larousse.",null,B.bl,null,null,null,null,null,null)
